#
# TABLE STRUCTURE FOR: academic_syllabus
#

DROP TABLE IF EXISTS `academic_syllabus`;

CREATE TABLE `academic_syllabus` (
  `academic_syllabus_id` int(11) NOT NULL AUTO_INCREMENT,
  `academic_syllabus_code` longtext COLLATE utf8_unicode_ci NOT NULL,
  `title` longtext COLLATE utf8_unicode_ci NOT NULL,
  `description` longtext COLLATE utf8_unicode_ci NOT NULL,
  `class_id` int(11) NOT NULL,
  `uploader_type` longtext COLLATE utf8_unicode_ci NOT NULL,
  `uploader_id` int(11) NOT NULL,
  `year` longtext COLLATE utf8_unicode_ci NOT NULL,
  `timestamp` longtext COLLATE utf8_unicode_ci NOT NULL,
  `file_name` longtext COLLATE utf8_unicode_ci NOT NULL,
  `date_time` datetime NOT NULL,
  `isActive` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`academic_syllabus_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: admin
#

DROP TABLE IF EXISTS `admin`;

CREATE TABLE `admin` (
  `admin_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext COLLATE utf8_unicode_ci NOT NULL,
  `email` longtext COLLATE utf8_unicode_ci NOT NULL,
  `password` longtext COLLATE utf8_unicode_ci NOT NULL,
  `level` longtext COLLATE utf8_unicode_ci NOT NULL,
  `authentication_key` longtext COLLATE utf8_unicode_ci NOT NULL,
  `image` varchar(256) COLLATE utf8_unicode_ci NOT NULL,
  `passcode` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `device_token` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`admin_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: admin_bus
#

DROP TABLE IF EXISTS `admin_bus`;

CREATE TABLE `admin_bus` (
  `admin_bus_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext NOT NULL,
  `email` longtext NOT NULL,
  `password` longtext NOT NULL,
  `phone` longtext NOT NULL,
  `sex` longtext NOT NULL,
  PRIMARY KEY (`admin_bus_id`),
  UNIQUE KEY `admin_bus_id` (`admin_bus_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: admin_device
#

DROP TABLE IF EXISTS `admin_device`;

CREATE TABLE `admin_device` (
  `imei` bigint(20) NOT NULL,
  `Admin_id` int(11) NOT NULL,
  UNIQUE KEY `Device_Id` (`imei`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: app_info
#

DROP TABLE IF EXISTS `app_info`;

CREATE TABLE `app_info` (
  `app_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(20) DEFAULT NULL,
  `device_token` varchar(500) DEFAULT NULL,
  `device_id` varchar(500) NOT NULL,
  `latitude` varchar(40) DEFAULT NULL,
  `longitude` varchar(40) DEFAULT NULL,
  `device_type` enum('android','ios','blackbery','windows') NOT NULL DEFAULT 'android',
  `added_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `passcode` varchar(30) DEFAULT NULL,
  `admin_id` int(11) DEFAULT NULL,
  `user_type` tinyint(1) DEFAULT NULL COMMENT '1=>parent,2=>admin,3=>teacher',
  `teacher_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`app_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: applied_students
#

DROP TABLE IF EXISTS `applied_students`;

CREATE TABLE `applied_students` (
  `student_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_code` longtext COLLATE utf8_unicode_ci NOT NULL,
  `name` longtext COLLATE utf8_unicode_ci,
  `birthday` longtext COLLATE utf8_unicode_ci NOT NULL,
  `sex` longtext COLLATE utf8_unicode_ci NOT NULL,
  `religion` longtext COLLATE utf8_unicode_ci NOT NULL,
  `blood_group` longtext COLLATE utf8_unicode_ci NOT NULL,
  `address` longtext COLLATE utf8_unicode_ci NOT NULL,
  `phone` longtext COLLATE utf8_unicode_ci NOT NULL,
  `email` longtext COLLATE utf8_unicode_ci NOT NULL,
  `password` longtext COLLATE utf8_unicode_ci NOT NULL,
  `parent_id` int(11) NOT NULL,
  `dormitory_id` int(11) NOT NULL,
  `transport_id` int(11) NOT NULL,
  `dormitory_room_number` longtext COLLATE utf8_unicode_ci NOT NULL,
  `authentication_key` longtext COLLATE utf8_unicode_ci NOT NULL,
  `card_id` bigint(20) NOT NULL,
  `mname` longtext COLLATE utf8_unicode_ci NOT NULL,
  `lname` longtext COLLATE utf8_unicode_ci NOT NULL,
  `passport_no` longtext COLLATE utf8_unicode_ci NOT NULL,
  `icard_no` longtext COLLATE utf8_unicode_ci NOT NULL,
  `type` longtext COLLATE utf8_unicode_ci NOT NULL,
  `country` longtext COLLATE utf8_unicode_ci NOT NULL,
  `nationality` longtext COLLATE utf8_unicode_ci NOT NULL,
  `place_of_birth` longtext COLLATE utf8_unicode_ci NOT NULL,
  `previous_school` longtext COLLATE utf8_unicode_ci NOT NULL,
  `course` longtext COLLATE utf8_unicode_ci NOT NULL,
  `stud_image` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `location` longtext COLLATE utf8_unicode_ci NOT NULL,
  `loc_cords` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `submitted` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  `current_status` enum('0','1','2') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `date_time` datetime NOT NULL,
  `change_time` datetime NOT NULL,
  PRIMARY KEY (`student_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: attendance
#

DROP TABLE IF EXISTS `attendance`;

CREATE TABLE `attendance` (
  `attendance_id` int(11) NOT NULL AUTO_INCREMENT,
  `timestamp` longtext COLLATE utf8_unicode_ci NOT NULL,
  `year` longtext COLLATE utf8_unicode_ci NOT NULL,
  `class_id` int(11) NOT NULL,
  `section_id` int(11) NOT NULL,
  `student_id` int(11) NOT NULL,
  `class_routine_id` int(11) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0(undefined) 1(present) 2(absent)',
  PRIMARY KEY (`attendance_id`),
  UNIQUE KEY `unqueattendence` (`timestamp`(20),`year`(20),`student_id`)
) ENGINE=InnoDB AUTO_INCREMENT=107 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: attendance_backup
#

DROP TABLE IF EXISTS `attendance_backup`;

CREATE TABLE `attendance_backup` (
  `attendance_id` int(11) NOT NULL AUTO_INCREMENT,
  `status` int(11) NOT NULL COMMENT '0 undefined , 1 present , 2  absent',
  `student_id` int(11) NOT NULL,
  `date` date NOT NULL,
  `year` longtext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `class_id` int(11) NOT NULL,
  `section_id` int(11) NOT NULL,
  `session` longtext NOT NULL,
  PRIMARY KEY (`attendance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: book
#

DROP TABLE IF EXISTS `book`;

CREATE TABLE `book` (
  `book_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext COLLATE utf8_unicode_ci NOT NULL,
  `description` longtext COLLATE utf8_unicode_ci NOT NULL,
  `author` longtext COLLATE utf8_unicode_ci NOT NULL,
  `class_id` longtext COLLATE utf8_unicode_ci NOT NULL,
  `status` longtext COLLATE utf8_unicode_ci NOT NULL,
  `price` longtext COLLATE utf8_unicode_ci NOT NULL,
  `currency` longtext COLLATE utf8_unicode_ci NOT NULL,
  `date_time` datetime NOT NULL,
  `change_time` datetime NOT NULL,
  `isActive` enum('0','1') COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`book_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: book_category
#

DROP TABLE IF EXISTS `book_category`;

CREATE TABLE `book_category` (
  `category_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `category_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `category_status` enum('','Active','Inactive') COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: book_issue_table
#

DROP TABLE IF EXISTS `book_issue_table`;

CREATE TABLE `book_issue_table` (
  `issue_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `user_type` enum('','Student','Teacher') COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `book_unique_id` int(11) NOT NULL DEFAULT '0',
  `issue_date` date NOT NULL DEFAULT '0000-00-00',
  `issue_by` int(11) NOT NULL,
  `return_date` date NOT NULL DEFAULT '0000-00-00',
  `return_to` int(11) NOT NULL DEFAULT '0',
  `status` enum('','Issued','Returned','Lost') COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`issue_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: book_subcategory
#

DROP TABLE IF EXISTS `book_subcategory`;

CREATE TABLE `book_subcategory` (
  `subcategory_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(11) NOT NULL DEFAULT '0',
  `subcategory_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `subcategory_status` enum('','Active','Inactive') COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`subcategory_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: books
#

DROP TABLE IF EXISTS `books`;

CREATE TABLE `books` (
  `book_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `subcategory_id` int(11) NOT NULL,
  `book_title` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `book_author` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `isbn_number` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `book_note` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`book_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: books_list
#

DROP TABLE IF EXISTS `books_list`;

CREATE TABLE `books_list` (
  `book_unique_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `book_id` int(11) NOT NULL,
  `book_issue_status` enum('','Yes','No') COLLATE utf8_unicode_ci NOT NULL,
  `book_status` enum('','Active','Damage','Lost') COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`book_unique_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: books_stock
#

DROP TABLE IF EXISTS `books_stock`;

CREATE TABLE `books_stock` (
  `stock_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `book_id` int(11) NOT NULL DEFAULT '0',
  `no_of_books` int(11) NOT NULL DEFAULT '0',
  `supplier_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `bill_number` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `total_price` decimal(10,0) NOT NULL DEFAULT '0',
  PRIMARY KEY (`stock_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: bus
#

DROP TABLE IF EXISTS `bus`;

CREATE TABLE `bus` (
  `bus_id` int(11) NOT NULL AUTO_INCREMENT,
  `bus_unique_key` longtext NOT NULL,
  `name` longtext NOT NULL,
  `description` longtext NOT NULL,
  `route_id` longtext NOT NULL,
  `device_imei` bigint(20) NOT NULL,
  PRIMARY KEY (`bus_id`),
  UNIQUE KEY `bus_id` (`bus_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: bus_administrator
#

DROP TABLE IF EXISTS `bus_administrator`;

CREATE TABLE `bus_administrator` (
  `bus_administrator_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext NOT NULL,
  `sex` longtext NOT NULL,
  `phone` longtext NOT NULL,
  `email` longtext NOT NULL,
  `password` longtext NOT NULL,
  `bus_driver_list` longtext NOT NULL,
  PRIMARY KEY (`bus_administrator_id`),
  UNIQUE KEY `bus_administrator_id` (`bus_administrator_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: bus_attendence
#

DROP TABLE IF EXISTS `bus_attendence`;

CREATE TABLE `bus_attendence` (
  `bus_attendence_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(255) NOT NULL,
  `class_id` int(255) NOT NULL,
  `bus_id` longtext NOT NULL,
  `route_id` longtext NOT NULL,
  `transport_group` longtext NOT NULL,
  `bus_in` longtext NOT NULL COMMENT '0(absent) 1(present)',
  `bus_out` longtext NOT NULL COMMENT '0(absent) 1(present)',
  `session` longtext NOT NULL COMMENT '0(morning) 1(evening)',
  `date` longtext NOT NULL,
  `year` longtext NOT NULL,
  `in_timestamp` longtext NOT NULL,
  `out_timestamp` longtext NOT NULL,
  PRIMARY KEY (`bus_attendence_id`),
  UNIQUE KEY `bus_attendence_id` (`bus_attendence_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: bus_driver
#

DROP TABLE IF EXISTS `bus_driver`;

CREATE TABLE `bus_driver` (
  `bus_driver_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext NOT NULL,
  `sex` longtext NOT NULL,
  `phone` longtext NOT NULL,
  `email` longtext NOT NULL,
  `password` longtext NOT NULL,
  `route_id` longtext NOT NULL,
  `do_upload` longtext NOT NULL COMMENT '0(no) 1(yes)',
  `admin_approve` longtext NOT NULL COMMENT '0(no) 1(yes)',
  `bus_id` longtext NOT NULL,
  PRIMARY KEY (`bus_driver_id`),
  UNIQUE KEY `bus_driver_id` (`bus_driver_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: bus_driver_attendence
#

DROP TABLE IF EXISTS `bus_driver_attendence`;

CREATE TABLE `bus_driver_attendence` (
  `bus_driver_attendence_id` int(11) NOT NULL AUTO_INCREMENT,
  `driver_id` longtext NOT NULL,
  `route_id` longtext NOT NULL,
  `route_group` longtext NOT NULL,
  `bus_id` longtext NOT NULL,
  `session` longtext NOT NULL COMMENT '0(morning) 1(evening)',
  `date` longtext NOT NULL,
  `year` longtext NOT NULL,
  `timestamp` longtext NOT NULL,
  PRIMARY KEY (`bus_driver_attendence_id`),
  UNIQUE KEY `bus_driver_attendence_id` (`bus_driver_attendence_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: bus_images
#

DROP TABLE IF EXISTS `bus_images`;

CREATE TABLE `bus_images` (
  `bus_images_id` int(11) NOT NULL,
  `driver_id` longtext NOT NULL,
  `route_id` longtext NOT NULL,
  `route_group` longtext NOT NULL,
  `bus_id` longtext NOT NULL,
  `session` longtext NOT NULL,
  `date` longtext NOT NULL,
  `year` longtext NOT NULL,
  `timestamp` longtext NOT NULL,
  `bus_admin_id` longtext NOT NULL,
  `images` longtext NOT NULL,
  PRIMARY KEY (`bus_images_id`),
  UNIQUE KEY `bus_images_id` (`bus_images_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: categories
#

DROP TABLE IF EXISTS `categories`;

CREATE TABLE `categories` (
  `categories_id` int(11) NOT NULL AUTO_INCREMENT,
  `categories_name` varchar(255) NOT NULL,
  `categories_status` varchar(255) NOT NULL,
  PRIMARY KEY (`categories_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: ci_sessions
#

DROP TABLE IF EXISTS `ci_sessions`;

CREATE TABLE `ci_sessions` (
  `id` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  `ip_address` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `timestamp` int(10) unsigned NOT NULL DEFAULT '0',
  `data` blob NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ci_sessions_timestamp` (`timestamp`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: class
#

DROP TABLE IF EXISTS `class`;

CREATE TABLE `class` (
  `class_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext COLLATE utf8_unicode_ci NOT NULL,
  `name_numeric` int(11) NOT NULL,
  `teacher_id` int(11) NOT NULL,
  `isActive` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`class_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: class_routine
#

DROP TABLE IF EXISTS `class_routine`;

CREATE TABLE `class_routine` (
  `class_routine_id` int(11) NOT NULL AUTO_INCREMENT,
  `class_id` int(11) NOT NULL,
  `section_id` int(11) NOT NULL,
  `subject_id` int(11) NOT NULL,
  `time_start` int(11) NOT NULL,
  `time_end` int(11) NOT NULL,
  `time_start_min` int(11) NOT NULL,
  `time_end_min` int(11) NOT NULL,
  `day` longtext COLLATE utf8_unicode_ci NOT NULL,
  `year` longtext COLLATE utf8_unicode_ci NOT NULL,
  `teacher_id` int(11) NOT NULL,
  `isActive` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`class_routine_id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: dashbord_notification
#

DROP TABLE IF EXISTS `dashbord_notification`;

CREATE TABLE `dashbord_notification` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `activity` varchar(500) NOT NULL,
  `sms` int(11) NOT NULL,
  `push_notify` int(11) NOT NULL,
  `email` int(11) NOT NULL,
  `date` date NOT NULL,
  `status` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=111 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: device
#

DROP TABLE IF EXISTS `device`;

CREATE TABLE `device` (
  `Device_ID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` varchar(150) NOT NULL,
  `Imei` bigint(20) NOT NULL,
  `SIM` bigint(20) NOT NULL,
  `Location` varchar(100) NOT NULL,
  `islive` tinyint(1) NOT NULL,
  PRIMARY KEY (`Device_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: device_signal
#

DROP TABLE IF EXISTS `device_signal`;

CREATE TABLE `device_signal` (
  `imei` bigint(20) NOT NULL,
  `date` datetime NOT NULL,
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `card_id` bigint(20) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: discussion_comments
#

DROP TABLE IF EXISTS `discussion_comments`;

CREATE TABLE `discussion_comments` (
  `comment_id` int(25) NOT NULL AUTO_INCREMENT,
  `discussion_id` int(25) NOT NULL,
  `comment_body` varchar(500) NOT NULL,
  `comment_created` datetime NOT NULL,
  `comment_user_id` int(25) NOT NULL,
  `comment_isActive` enum('0','1') NOT NULL,
  PRIMARY KEY (`comment_id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: discussion_forums
#

DROP TABLE IF EXISTS `discussion_forums`;

CREATE TABLE `discussion_forums` (
  `discussion_id` int(9) NOT NULL AUTO_INCREMENT,
  `user_id` int(9) NOT NULL,
  `discussion_title` varchar(150) NOT NULL,
  `disucssion_body` varchar(500) NOT NULL,
  `discussion_created` datetime NOT NULL,
  `discussion_isActive` enum('0','1') NOT NULL DEFAULT '1',
  PRIMARY KEY (`discussion_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: document
#

DROP TABLE IF EXISTS `document`;

CREATE TABLE `document` (
  `document_id` int(11) NOT NULL AUTO_INCREMENT,
  `title` longtext COLLATE utf8_unicode_ci NOT NULL,
  `description` longtext COLLATE utf8_unicode_ci NOT NULL,
  `file_name` longtext COLLATE utf8_unicode_ci NOT NULL,
  `file_type` longtext COLLATE utf8_unicode_ci NOT NULL,
  `class_id` longtext COLLATE utf8_unicode_ci NOT NULL,
  `teacher_id` int(11) NOT NULL,
  `timestamp` longtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`document_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: dormitory
#

DROP TABLE IF EXISTS `dormitory`;

CREATE TABLE `dormitory` (
  `dormitory_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `hostel_type` enum('Boys','Girls') NOT NULL,
  `hostel_address` varchar(255) NOT NULL,
  `phone_number` bigint(20) NOT NULL,
  `warden_id` varchar(255) NOT NULL,
  PRIMARY KEY (`dormitory_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: enquired_students
#

DROP TABLE IF EXISTS `enquired_students`;

CREATE TABLE `enquired_students` (
  `enquired_student_id` int(9) NOT NULL AUTO_INCREMENT,
  `admission_form_id` varchar(250) NOT NULL,
  `student_fname` varchar(25) NOT NULL,
  `student_lname` varchar(25) NOT NULL,
  `parent_fname` varchar(25) NOT NULL,
  `parent_lname` varchar(25) NOT NULL,
  `class_id` int(9) NOT NULL,
  `birthday` date NOT NULL,
  `address` varchar(250) NOT NULL,
  `address_second` varchar(250) DEFAULT NULL,
  `city` varchar(25) NOT NULL,
  `region` varchar(25) NOT NULL,
  `zip_code` varchar(20) NOT NULL,
  `country` varchar(25) NOT NULL,
  `user_email` varchar(25) DEFAULT NULL,
  `mobile_number` varchar(20) DEFAULT NULL,
  `phone` varchar(20) NOT NULL,
  `work_phone` varchar(20) DEFAULT NULL,
  `advance` enum('yes','no') NOT NULL,
  `transport` enum('yes','no') DEFAULT NULL,
  `mother_fname` varchar(25) NOT NULL,
  `mother_lname` varchar(25) NOT NULL,
  `previous_class` int(9) DEFAULT NULL,
  `previous_school` varchar(50) DEFAULT NULL,
  `previous_result` varchar(20) DEFAULT NULL,
  `caste_category` varchar(20) NOT NULL,
  `gender` varchar(20) NOT NULL,
  `create_date` datetime NOT NULL,
  `form_genreated` tinyint(1) NOT NULL DEFAULT '0',
  `student_id` int(11) DEFAULT NULL,
  `form_submitted` enum('0','1') DEFAULT NULL,
  `annual_salary` varchar(50) NOT NULL,
  `receipt_no` varchar(250) DEFAULT NULL,
  `counselling` tinyint(1) DEFAULT '0',
  `form_no` varchar(25) DEFAULT NULL,
  `guardian_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`enquired_student_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



