  `qualification` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `specialisation` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `experience` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `awards` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `summary` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `gender` longtext COLLATE utf8_unicode_ci,
  `religion` longtext COLLATE utf8_unicode_ci,
  `blood_group` longtext COLLATE utf8_unicode_ci,
  `address` longtext COLLATE utf8_unicode_ci,
  `city` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `zip_code` int(20) DEFAULT NULL,
  `state` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `country` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `nationality` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cell_phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `home_phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `work_phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `password` longtext COLLATE utf8_unicode_ci NOT NULL,
  `authentication_key` longtext COLLATE utf8_unicode_ci,
  `card_id` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `passport_number` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idcard_number` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idcard_type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
