  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`cell_phone`),
  KEY `emp_id` (`emp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
